import { useState } from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <h1>ToDo List</h1>
      <div className="App-header">
        <input placeholder="digite aqui" />
        <button style={{ marginLeft: 20 }}>Adicionar</button>
      </div>
    </div>
  );
}

export default App;
